import './App.css';
import { Route, Routes, Link, HashRouter } from "react-router-dom";
import NewArtwork from './NewArtwork';

function App() {
  return (
    <HashRouter>
      <Routes>
        <Route path="/newArtwork" element={<NewArtwork />}/>
      </Routes>
    </HashRouter>
  )
}

export default App;
